	$("body").on("click",".paging:not(.casePagination):not(.wizCasePagination) .next",function(e){
		sessionTimerFunc()
		if(!$(this).hasClass('disabled')){
			var fCount= parseInt($(this).closest('.paging').find('#fCount').text());
			var lCount = parseInt($(this).closest('.paging').find('#lCount').text());
			var tCount = parseInt($(this).closest('.paging').siblings('ul').children().length);
			var entry= Number(15);
			$(this).closest('.paging').siblings('ul').children().css('display','none');
			for(i=(lCount+1);i<=(lCount+entry);i++){
				$(this).closest('.paging').siblings('ul').find("li:nth-child("+i+")").css('display','block');
			}
			$(this).closest('.paging').find('#fCount').text(fCount+entry);
			$(this).closest('.paging').find('#lCount').text(lCount+entry);
			lCount = parseInt($(this).closest('.paging').find('#lCount').text());
			$(this).siblings('.previous').removeClass('disabled');
			if(tCount<lCount){
				$(this).closest('.paging').find('#lCount').text(tCount)
			}
			if($(this).closest('.paging').find('#lCount').text()==tCount){
				$(this).addClass('disabled');
			}
		}
	});

	$("body").on("click",".paging:not(.casePagination):not(.wizCasePagination) .previous",function(){
		sessionTimerFunc()
		if(!$(this).hasClass('disabled')){
			var fCount= parseInt($(this).closest('.paging').find('#fCount').text());
			var lCount = parseInt($(this).closest('.paging').find('#lCount').text());
			var tCount = parseInt($(this).closest('.paging').siblings('ul').children().length);
			var entry= 15;
			$(this).closest('.paging').siblings('ul').children().css('display','none');
			if(fCount-entry>0){
				for(i=(fCount-entry);i<=(fCount-1);i++){
					$(this).closest('.paging').siblings('ul').find("li:nth-child("+i+")").css('display','block');
				}
				$(this).closest('.paging').find('#fCount').text(fCount-entry);
				$(this).closest('.paging').find('#lCount').text(fCount-1);
			}else{
				for(i=1;i<=entry;i++){
					$(this).closest('.paging').siblings('ul').find("li:nth-child("+i+")").css('display','block');
				}
				$(this).closest('.paging').find('#fCount').text(1);
				$(this).closest('.paging').find('#lCount').text(entry);
			}

			$(this).siblings('.next').removeClass('disabled');
			if($(this).closest('.paging').find('#fCount').text()==1){
				$(this).addClass('disabled');
			}
		}
	});

