	// Change Unit
	$("body").on("click","#unitConversionPopup #saveUnit,#unitConvertOption #changeUnit",function(e){
		sessionTimerFunc()
		e.stopPropagation();
		var unitId=$("input[name=unitsCon]:checked").val();
		var data={"designID":shareDesId,
				"unitID":unitId
		}
		displayLoader();
		$.ajax({
			type : "POST",
			url :"/products/configurator/saveUnit",
			contentType: "application/json; charset=utf-8",
			dataType : "json",
			cache: false,
			data :JSON.stringify({"jsonStr":data})
		}).done(function(jsonData){
			hideLoader();
			$(".leftArrow").hide(250);
			if(jsonData!=""){
				jsonData=JSON.parse(jsonData)
				if(jsonData.status==1){
					displayLoader();
					projects[projIndex].unitType=unitId;
					unitType = unitId;
					projects[projIndex].designList[shareDesIndex].unitType=unitId;
					$(".projectLi.active").find(".unitType").val(unitId);
					$("#designLi li:eq("+shareDesIndex+")").find(".desUType").val(unitId);
					$('.arrowBox').hide(250);
					$("#successMessage").show(250);
					$("#successMessage .message").show(250).html("Units have been updated");
					if(wizardJSON != "" || wizardJSON != []){// Update the
																// wizard Json
																// so that unit
																// is updated in
																// design also
						if(technoId.toString() == "3"){
							$.each(wizardJSON.wizardPrprty.settings,function(){
								if(this.prpertyId==754){
									if(unitId == "63"){
										wizardJSON.wizardPrprty.drgDrpDsgnDetails.unitType = "63";
										this.dropDownValue = ["Metric","US Standard"];
									}else{
										wizardJSON.wizardPrprty.drgDrpDsgnDetails.unitType = "64";
										this.dropDownValue = ["US Standard","Metric"];
									}
									return false;
								}
							});
						}else if(technoId.toString() == "4" || technoId.toString() == "7"){
							$.each(wizardJSON[0].propertyGroup,function(){
								$.each(this.componentPropertyList,function(){
									if(this.pdmpropertyMasterIdentifier==1600 || this.pdmpropertyMasterIdentifier==6001){
										if(unitId == "63"){
											this.dropdownKeys[0] = ["Metric","US Standard"];
											wizardJSON[0].unitType="63";
											unitType = "63";	
										}else{
											this.dropdownKeys[0] = ["US Standard","Metric"];
											wizardJSON[0].unitType="64";
											unitType = "64";
										}
										return false;
									}
								})
							});
						}else{
							if(unitId == "63"){
								wizardJSON[0].unitType="63";
								unitType = "63";	
							}else{
								wizardJSON[0].unitType="64";
								unitType = "64";
							}
						}
					}
					
					
					// Update globalJSON
					if(globalJSON != null){
						if(unitId == "63"){ 
							 globalJSON.unitConversion = "";
							 globalJSON.unitType = "63";
						  }else{//US Standard 
							  globalJSON.unitConversion = "Y"; 
							  globalJSON.unitType = "64";
						  }
					}
				}
			}else{
				displayLoader();
				$("#failureMessage").show(250);
				$("#failureMessage .message").show(250).html("Units are not been updated");
			}
		}).fail(function(data,textStatus,message){
			if(textStatus=="timeout"){
				$(".leftArrow").hide(250);
				$("#failureMessage").show(250);
				$("#failureMessage .message").show(250).html("Test Units are not been updated");
				return false;
			}
			$(".leftArrow").hide(250);
			$("#failureMessage").show(250);
			$("#failureMessage .message").show(250).html("Units are not been updated");
		});

	});
	

