	$("body").on('click',"#delegProj,.searchContent .glyphicon:not('.disableDelegate')", function(e) {			// Delegate
																												// Project
		sessionTimerFunc()
		e.stopPropagation();
		var showProjName = projectName;
		// var ;//for outer search, need proj owner name //variable moved
		// globally
		var targetElmnt=$(e.target).parent();
		$(window).scrollTop($("#projectList"));
		if(targetElmnt.hasClass('searchContent')){// outer search has this
													// class
			projOwnerId=targetElmnt.find('.searchProjOwnId').val();// getting
																	// project
																	// owner ID
			projectId=targetElmnt.find('.searchProjId').val();// getting
																// projectID
			showProjName = $(this).siblings("b").text();
		}
		displayLoader();
		$(this).parent().parent().parent().find('.active').removeClass('active');
		$(this).parent().addClass('active');
		$("#delegatePopup input").focus();
		$('#delegatePopup .message,#delegatePopup .confirm').hide(250);
		$("#delegatePopup .header b").text(showProjName);
		$('#delegatePopup .userName').val("");
		$('#delegatePopup .userName').show(250);
		$('#delegatePopup label').show(250);
		$(".usersListDelegate ul").show(250);
		$("#delegatePopup #assignToNone").hide(250);
		$("#delegateCloseBtn").text("Cancel");
		displayLoader();
		$.ajax({ 
			type : "POST",
			url : "/products/configurator/getDelegationId",
			contentType: "application/json; charset=utf-8", 
			dataType : "text",
			cache: false,
			data : JSON.stringify({"ssoId":ssoId}) 
		}).done(function(jsonData){
			$("#delegatePopup,#delegateBtn").show(250);
			if(jsonData!=""){
				$(".usersListDelegate ul").empty();
				jsonData=JSON.parse(jsonData);
				for(counter=0;counter<jsonData.length;counter++){
					appendData+="<li class='users'>"+jsonData[counter].lname +", "+jsonData[counter].fname+"<input type='hidden' class='userId' value='"+jsonData[counter].uid+"'/></li>";
				}
				$(".usersListDelegate ul").append(appendData);
				if(targetElmnt.hasClass('searchContent')){
					$(".usersListDelegate ul").append("<li class='users'>"+lName +", "+fName+"<input type='hidden' class='userId' value='"+ssoId+"'/></li>");
					$(".usersListDelegate ul li").each(function(){
						if($(this).find('.userId').val()==projOwnerId){
							$(this).addClass("disabledUsers");
						}
					})
					$(".usersListDelegate ul").addClass("outerSearch");
				}
				appendData="";
				jsonData="";
			}else{
				$(".usersListDelegate ul").empty();
				appendData+="<li>No Data Available</li>" ;
				$(".usersListDelegate ul").append(appendData);
				appendData="";
				jsonData="";
			}
		}).fail(function(){
			$("#delegatePopup,#delegateBtn").show(250);
			$(".usersListDelegate ul").empty();
			appendData+="<li>No Data Available</li>" ;
			$(".usersListDelegate ul").append(appendData);
			appendData="";
			jsonData="";
		});
	});

