	$("body").on("keyup",'#createDesignPopup input[name="totalSeleium"], #createDesignPopup input[name="totalSeleniumEff"],#createDesignPopup input[name="nitrate"]',function(){
		sessionTimerFunc()
		var effVal=Number($('#createDesignPopup input[name="totalSeleniumEff"]').val())
		var FeedSourceVal=Number($('#createDesignPopup input[name="totalSeleium"]').val());
		var feedSourceNitrate=Number($('#createDesignPopup input[name="nitrate"]').val());
		if(stgId==1){
			if(effVal<10 || ((FeedSourceVal-effVal)/FeedSourceVal)>0.9){// check
																		// if
																		// stage
																		// 2
																		// should
																		// be
																		// recommended
				$("#createDesignPopup .message").addClass("warning").removeClass("errorMsg").text("Two stage design recommended for Se removal >90% and Effluent Se ≤10 ppm.").slideDown(0);
			}else{
				$("#createDesignPopup .message").slideUp(0,function(){
					$(this).removeClass("warning")
				})
			}
			// to add warnings ((Total Selenium ≤ 100 && Nitrate ≤ 20) || (Total
			// Selinium = 1000 && Nitrate <5) ||(100 ≤ Total Selinium ≤ 1000 &&
			// Nitrate ≤ (-0.0167 * Total Selinium + 21.667))
			if((FeedSourceVal<=100 && feedSourceNitrate<=20) || (FeedSourceVal==1000 && feedSourceNitrate<5) ||(100<=FeedSourceVal<=1000 && feedSourceNitrate<=(-0.0167 * FeedSourceVal + 21.667))){
				$("#createDesignPopup .message").slideUp(0,function(){
					$(this).removeClass("warning")
				})
			}else{
				$("#createDesignPopup .message").addClass("warning").removeClass("errorMsg").text("Two stages design recommended based on influent and effluent parameters.").slideDown(0);
			}
		}else if(stgId==2){
			if(effVal>10 && ((FeedSourceVal-effVal)/FeedSourceVal)<0.9){// check
																		// if
																		// stage
																		// 1
																		// should
																		// be
																		// recommended
				$("#createDesignPopup .message").addClass("warning").removeClass("errorMsg").text("Single stage design recommended based for Se removal<90% and Effluent Se >10 ppm.").slideDown(0);
			}else{
				$("#createDesignPopup .message").slideUp(0,function(){
					$(this).removeClass("warning")
				})
			}
			// to add warnings ((Total Selenium ≤ 100 && Nitrate ≤ 20) || (Total
			// Selinium = 1000 && Nitrate <5) ||(100 ≤ Total Selinium ≤ 1000 &&
			// Nitrate ≤ (-0.0167 * Total Selinium + 21.667))
			if((FeedSourceVal<=100 && feedSourceNitrate<=20) || (FeedSourceVal==1000 && feedSourceNitrate<5) ||(100<=FeedSourceVal<=1000 && feedSourceNitrate<=(-0.0167 * FeedSourceVal + 21.667))){
				$("#createDesignPopup .message").addClass("warning").removeClass("errorMsg").text("Single stage design recommended based on influent and effluent parameters.").slideDown(0);
			}else{
				$("#createDesignPopup .message").slideUp(0,function(){
					$(this).removeClass("warning")
				})

			}
		}
	})

