																						// the
																						// warning
																						// already
																						// exists
																						// fr
																						// some
																						// other
																						// case
				var cases=$("#C00003warning,#C00015warning").find(".stdTankWarn").attr("data-value")// Take
																									// the
																									// already
																									// existing
																									// cases
				var index=$.inArray(caseNum,cases);// Take the index of the
