	function getApplicationTier(selectedTier,appTierNo){
		sessionTimerFunc()
		displayLoader();
		if(appTierNo == "2"){
		//	$("#appTier2").attr("disabled", true);
		//	$("#appTier3").attr("disabled", true);
		//	$("#appTier4").attr("disabled", true);
		}else if(appTierNo == "3"){
		//	$("#appTier3").attr("disabled", true);
		//	$("#appTier4").attr("disabled", true);
		}else if(appTierNo == "4"){
		//	$("#appTier4").attr("disabled", true);
		}
		var jsonStr = {"selectedTier":selectedTier,"appTierNo":appTierNo};
		$.ajax({  type : "POST",
			url : "/products/configurator/getApplicationTier",  
			contentType: "application/json; charset=utf-8", 
			dataType : "text",
			data :JSON.stringify({"jsonStr":jsonStr}), 
		}).done(function(jsonData){
			jsonData = JSON.parse(jsonData);
			jsonData = jsonData.replace("[","").replace("]","").split(",");
			var dataTier = jsonData;
			if(appTierNo == "2"){
				$("#appTier2").attr("disabled", false);
				$("#appTier2").empty();
				$("#appTier3").empty();
				$("#appTier4").empty();
				$("#appTier2").append('<option value="0">--Select--</option>');
				if(jsonData[0] == '""'){
					$("#appTier2").attr("disabled", true);
				}
				$.each(dataTier,function(i,v){
					dataTier[i] = dataTier[i].substring(1,dataTier[i].length-1);
					$("#appTier2").append('<option value="'+dataTier[i]+'">'+dataTier[i]+'</option>');
				})
				$("#appTier3").append('<option value="0">--Select--</option>');
				$("#appTier4").append('<option value="0">--Select--</option>');
			}else if(appTierNo == "3"){
				$("#appTier3").attr("disabled", false);
				$("#appTier3").empty();
				$("#appTier4").empty();
				$("#appTier3").append('<option value="0">--Select--</option>');
				if(jsonData[0] == '""'){
					$("#appTier3").attr("disabled", true);
					$("#appTier4").attr("disabled", true);
				}
				$.each(dataTier,function(i,v){
					dataTier[i] = dataTier[i].substring(1,dataTier[i].length-1);
					$("#appTier3").append('<option value="'+dataTier[i]+'">'+dataTier[i]+'</option>');
				})
				$("#appTier4").append('<option value="0">--Select--</option>');
			}else if(appTierNo == "4"){
				$("#appTier4").attr("disabled", false);
				$("#appTier4").empty();
				$("#appTier4").append('<option value="0">--Select--</option>');
				if(jsonData[0] == '""'){
					$("#appTier4").attr("disabled", true);
				}
				$.each(dataTier,function(i,v){
					dataTier[i] = dataTier[i].substring(1,dataTier[i].length-1);
					$("#appTier4").append('<option value="'+dataTier[i]+'">'+dataTier[i]+'</option>');
				})
			}
			hideLoader();
		}).fail(function(){
			hideLoader();
			alert("Error.")
		});
	}
	
	function checkReviewWarnings(){
		var errReviewMsg="";
		if(scopeOrSpare!="1" && scopeOrSpare!="2" && scopeOrSpareIGF != "1"  && scopeOrSpareIGF != "2"  && scopeOrSpareNSF != "1"  && scopeOrSpareNSF != "2"  && scopeOrSpareDH != "1"  && scopeOrSpareDH != "2"  && scopeOrSpareWHD != "1"  && scopeOrSpareWHD != "2" && scopeOrSpareBPM != "1"  && scopeOrSpareBPM != "2"){
			errReviewMsg = "Please configure the project with Scope or Spares";
			return errReviewMsg;
		}
		 if(roleId!="1" && roleId!="2"){
		//if(roleId!="2"){
			if(scopeOrSpare=="1" || scopeOrSpare=="2" || scopeOrSpareIGF == "1"  || scopeOrSpareIGF == "2" || scopeOrSpareNSF == "1"  || scopeOrSpareNSF == "2" || scopeOrSpareDH == "1"  || scopeOrSpareDH == "2" || scopeOrSpareWHD == "1"  || scopeOrSpareWHD == "2" || scopeOrSpareBPM == "1"  || scopeOrSpareBPM == "2"){
				if(reqEngReview=="1" ){ //checking warnings 
					if(checkEngStatus!="Approved"){ //Status
						errReviewMsg = "Please remove the warnings or wait for its approval";
						return errReviewMsg;
			          }
				}
				if(reqPriceDeviation=="1" ){ //price deviation
					if(priceStatus!="Approved"){ //status
						errReviewMsg = "2";
						return errReviewMsg;
			          }
				}
			}
		}
		return errReviewMsg;
		
	}
