	function getDispostionReasons(quoteStatus){
		sessionTimerFunc()
		displayLoader();
		$.ajax({  type : "POST",
			url : "/products/configurator/getDispositionReasons",  
			contentType: "application/json; charset=utf-8", 
			dataType : "text",
			data :JSON.stringify({"quoteStatus":quoteStatus}),
			 cache: false
			 
		}).done(function(jsonData){
			jsonData = JSON.parse(jsonData);
			var dataTier = jsonData;
				$("#dispsReason").empty();
				$.each(dataTier,function(i,v){
					$("#dispsReason").append('<option value="'+dataTier[i]+'">'+dataTier[i]+'</option>');
				})
		$("#dispsReason").multiselect("reload");
		$('#dispsReason').multiselect({
            columns: 1,
            search: true,
            placeholder: '--Select--',
            searchOptions: {
                'default': 'Search Reasons'
            },
            selectAll: false
        });
		
		if(dspReasons!=null && dspReasons!=""){
		var comp = dspReasons;
		comp = comp.split(",");
		var inputs = $("#dispositionPopUp .ms-options").children().find("input:checkbox")
		$.each(comp,function(indexes){
		    $.each(inputs,function(){
		        if($(this).attr('title') == comp[indexes]){
		        	$(this).trigger("click");
		        }
		    })
		})
		}
			hideLoader();
		}).fail(function(){
			hideLoader();
			alert("Error.")
		});
	}
	
	
	function numberWithCommas(x) {
	    return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
	}
	
	
